import React from 'react';
import PropTypes from 'prop-types';
import * as roomDetails from "../roomDetails";
import { Dialog, RadioButton, RadioGroup } from "lucid-ui";
import _ from 'lodash';



function SelectRoomModel({ isOpen, onSelect }) {
  const rooms = _.keys(roomDetails);
  return (
    <div>
      <Dialog
        isShown={isOpen}
        Header="Select a room"
        size="small"
      >
        <RadioGroup>
          {_.map(rooms, room => (
            <li>
              <label onClick={() => onSelect(room)}>{room}</label>
              <RadioButton
                name="interactive-radio-buttons"
                onSelect={() => onSelect(room)}
              />
            </li>
          ))}
        </RadioGroup>



        {_.map(rooms, room => {

        })}
      </Dialog>
    </div>
  );
}

SelectRoomModel.propTypes = {
  isOpen: PropTypes.bool.isRequired,
  onSelect: PropTypes.func.isRequired,
};

export default SelectRoomModel;
